import React, { useState } from 'react';
import styled from 'styled-components';

import SearchIcon from '@mui/icons-material/Search';

const Header = () => {
  const versionOptions = [
    { label: 'Set 7', value: 'set7' },
    { label: 'Set 6.5', value: 'set6.5' },
  ];
  const langOptions = [
    { label: 'NA', value: 'na' },
    { label: 'BR', value: 'br' },
    { label: 'EUNE', value: 'eune' },
    { label: 'EUW', value: 'euw' },
    { label: 'JP', value: 'jp' },
    { label: 'KR', value: 'kr' },
    { label: 'LAN', value: 'lan' },
    { label: 'LAS', value: 'las' },
    { label: 'OCE', value: 'oce' },
    { label: 'TR', value: 'tr' },
    { label: 'RU', value: 'ru' },
  ];

  const [value, setValue] = useState('Set 7');
  const handleChange = (event) => {
    setValue(event.target.value);
  };

  return (
    <Container>
      <Nav>
        <NavWrapper>
          <img src='https://rerollcdn.com/brand.svg' alt='Logo' />
          <Dropdown
            options={versionOptions}
            value={value}
            onChange={handleChange}
          />
        </NavWrapper>
        <NavInputWrapper>
          <Dropdown
            options={langOptions}
            value={value}
            onChange={handleChange}
          />
          <Search placeholder='Search Summoner Name...' />
          <SearchIcon
            style={{
              color: '#fff',
              opacity: 0.75,
              height: 18,
              marginRight: 5,
            }}
          />
        </NavInputWrapper>
        <NavWrapper>
          <Download>Download App</Download>
        </NavWrapper>
      </Nav>
      <Menu>
        <ul>
          <li>
            <a href=''>Team Comps</a>
          </li>
          <li>
            <a href=''>Meta Report</a>
          </li>
          <li>
            <a href=''>Champions</a>
          </li>
          <li>
            <a href=''>Tier Lists</a>
          </li>
          <li>
            <a href=''>Item Builder</a>
          </li>
          <li>
            <a href=''>Team Builder</a>
          </li>
          <li>
            <a href=''>Database</a>
          </li>
          <li>
            <a href=''>Patch Notes</a>
          </li>
        </ul>
      </Menu>
    </Container>
  );
};

const Dropdown = ({ value, options, onChange }) => {
  return (
    <label>
      <select value={value} onChange={onChange}>
        {options.map((option) => {
          return <option value={option.value}>{option.label}</option>;
        })}
      </select>
    </label>
  );
};

export default Header;

const Container = styled.div`
  max-width: 1200px;
  width: 90%;
  margin: 0 auto;
`;

const Nav = styled.div`
  display: flex;
  justify-content: space-between;
  padding: 10px 0;
`;

const NavWrapper = styled.div`
  display: flex;
  align-items: center;
`;

const NavInputWrapper = styled.div`
  display: flex;
  align-items: center;
  border: 1px solid #17313a;
  border-radius: 4px;
`;

const Menu = styled.div``;

const Search = styled.input`
  color: hsla(0, 0%, 100%, 0.9);
  background-color: transparent;
  border: 0;
  font-family: 'Jost', sans-serif;
  padding: 5px;
  min-width: 220px;

  font-size: 14px;
  &:focus {
    outline: none;
  }
`;

const Download = styled.button``;
